import React from 'react';


const Model = ({active,setActive}) => {
    return (
        <div className='modal' onClick={() => setActive(false)} >
            <div className='model__centent' onClick={e => e.stopPropagation()}>

            </div>
        </div>
    );
};

export default Model;
